var $bm_rt;
var e, g, nMax, n, n, t, v, vl, vu, vu, tCur, segDur, tNext, nb, delta;
e = 0.5;
g = 5000;
nMax = 9;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time)
        n--;
}
if (n > 0) {
    t = sub(time, key(n).time);
    v = mul($bm_neg(velocityAtTime(sub(key(n).time, 0.001))), e);
    vl = length(v);
    if ($bm_isInstanceOfArray(value)) {
        vu = vl > 0 ? normalize(v) : [
            0,
            0,
            0
        ];
    } else {
        vu = v < 0 ? -1 : 1;
    }
    tCur = 0;
    segDur = div(mul(2, vl), g);
    tNext = segDur;
    nb = 1;
    while (tNext < t && nb <= nMax) {
        vl *= e;
        segDur *= e;
        tCur = tNext;
        tNext = sum(tNext, segDur);
        nb++;
    }
    if (nb <= nMax) {
        delta = sub(t, tCur);
        $bm_rt = sum(value, mul(mul(vu, delta), sub(vl, div(mul(g, delta), 2))));
    } else {
        $bm_rt = value;
    }
} else
    $bm_rt = value;

